import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './ProductComparison.css';

const ProductComparison = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { product } = location.state || {};
  const [isPriceAlertSet, setIsPriceAlertSet] = useState(false);

  // Find the lowest price among platforms
  const platforms = [
    { name: 'Amazon', price: product?.price },
    { name: 'Flipkart', price: product?.flipkartPrice },
    // Add other platforms as needed
  ].filter(p => p.price);

  const lowestPrice = Math.min(...platforms.map(p => 
    parseFloat(p.price.replace('₹', '').replace(',', ''))));

  const getBestPlatform = () => {
    return platforms.find(p => 
      parseFloat(p.price.replace('₹', '').replace(',', '')) === lowestPrice);
  };

  const handleSetPriceAlert = () => {
    // Implement price alert logic here
    setIsPriceAlertSet(true);
  };

  const handleBuyNow = (platformLink) => {
    window.open(platformLink, '_blank');
  };

  return (
    <div className="comparison-container">
      <button className="back-button" onClick={() => navigate(-1)}>
        ← Back to Search Results
      </button>
      
      <div className="comparison-content">
        <div className="product-image-section">
          <img src={product?.image} alt={product?.name} className="large-product-image" />
        </div>

        <div className="product-details-section">
          <h1 className="product-title">{product?.name}</h1>

          <div className="price-comparison">
            <h2>Price Comparison</h2>
            <table className="comparison-table">
              <thead>
                <tr>
                  <th>Platform</th>
                  <th>Price</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {platforms.map((platform) => (
                  <tr key={platform.name} 
                      className={platform.price.includes(lowestPrice.toString()) ? 'best-price' : ''}>
                    <td>{platform.name}</td>
                    <td>{platform.price}</td>
                    <td>
                      <button 
                        className={`go-to-store ${platform.price.includes(lowestPrice.toString()) ? 'glow' : ''}`}
                        onClick={() => handleBuyNow(product?.[`${platform.name.toLowerCase()}Link`])}>
                        Go to {platform.name}
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className="actions">
            <button 
              className="buy-now-button"
              onClick={() => handleBuyNow(product?.[`${getBestPlatform()?.name.toLowerCase()}Link`])}>
              Buy Now from {getBestPlatform()?.name} ({getBestPlatform()?.price})
            </button>

            <button 
              className={`price-alert-button ${isPriceAlertSet ? 'active' : ''}`}
              onClick={handleSetPriceAlert}>
              {isPriceAlertSet ? 'Price Alert Set!' : 'Set Price Alert'}
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductComparison;
